  //If the message is not mine
  //call the first div
  //else call the outcoming
  return (context=="incoming")?(
    <div className="chatBoobleIncoming">
        <div className="chatContentIncoming">
        {link&&<a href="https://discord.gg/CGqtPj9k"><p className="curser-pointer underline hover:text-white">{textInput}</p>
        <img src="/webside_logo.png" className="w-[200px] opacity-[0.7]"/> </a>}
        {!link&&<p>{textInput}</p>}
        <div className='chatInfo'>
        <p className="text-[12px]">{time}</p>
       
